### Problem17

Look at the following code.

```java
public class HowManyTimes
{
    public static void cube(int i)
    {
        i=i*i*i;
    }

    public static void main(String[] args) 
    {   
        for ( int i =0;i<10;i++)
        {
            cube(i);
        }
    }
}
```

The for loop will execute for _____(0)\___ times.

